import React, { useState } from "react";

const MoodTracker = () => {
  // State to manage the selected mood
  const [selectedMood, setSelectedMood] = useState(null);

  // Function to handle mood selection
  const handleMoodSelection = (mood) => {
    setSelectedMood(mood);
    // Additional logic here, such as saving the selected mood to a database
  };

  return (
    <div>
      <h2>Mood Tracker</h2>
      <p>Please select your current mood:</p>
      <div>
        <button onClick={() => handleMoodSelection("Happy")}>Happy</button>
        <button onClick={() => handleMoodSelection("Sad")}>Sad</button>
        <button onClick={() => handleMoodSelection("Angry")}>Angry</button>
        <button onClick={() => handleMoodSelection("Excited")}>Excited</button>
        {selectedMood && <p>You selected: {selectedMood}</p>}
      </div>
    </div>
  );
};

export default MoodTracker;
